import execjs
#编译js代码

with open('jsjjj.js', 'r',encoding='utf-8') as file:
    dates = file.read()
print(dates)
ctx = execjs.compile(dates)
#执行函数法一：
sign = ctx.eval("convert3('')") #eval方法中，整个函数调用包含在字符串中
print(sign)
